Net::MACInfo::MACEntry Net::MACInfo::uncMac = {0, 0, UTF8STRC("Unknown")};


const Net::MACInfo::MACEntry *Net::MACInfo::GetMACInfo(UInt64 macAddr)
{
	OSInt i = 0;
	OSInt j = (sizeof(macList) / sizeof(macList[0])) - 1;
	OSInt k;
	while (i <= j)
	{
		k = (i + j) >> 1;
		if (macAddr >= macList[k].rangeStart && macAddr <= macList[k].rangeEnd)
		{
			return &macList[k];
		}
		else if (macAddr < macList[k].rangeStart)
		{
			j = k - 1;
		}
		else
		{
			i = k + 1;
		}
	}
	return &uncMac;
}

const Net::MACInfo::MACEntry *Net::MACInfo::GetMACInfoBuff(const UInt8 *mac)
{
	UInt8 buff[8];
	buff[0] = 0;
	buff[1] = 0;
	buff[2] = mac[0];
	buff[3] = mac[1];
	buff[4] = mac[2];
	buff[5] = mac[3];
	buff[6] = mac[4];
	buff[7] = mac[5];
	return GetMACInfo(ReadMUInt64(buff));
}

const Net::MACInfo::MACEntry *Net::MACInfo::GetMACInfoOUI(const UInt8 *oui)
{
	UInt8 buff[8];
	buff[0] = 0;
	buff[1] = 0;
	buff[2] = oui[0];
	buff[3] = oui[1];
	buff[4] = oui[2];
	buff[5] = 0;
	buff[6] = 0;
	buff[7] = 0;
	return GetMACInfo(ReadMUInt64(buff));
}

Net::MACInfo::MACEntry *Net::MACInfo::GetMACEntryList(UOSInt *cnt)
{
	*cnt = sizeof(macList) / sizeof(macList[0]);
	return macList;
}
